g.script:
var opacity1 = 0;
		var opacity2 = 0;
		var opacity3 = 0;
		var opacity4 = 0;
		var flow1 = document.getElementById("flow1");
		var flow2 = document.getElementById("flow2");
		var flow3 = document.getElementById("flow3");
		var flow4 = document.getElementById("flow4");
		flow1.setAttribute('opacity', opacity1);
		flow2.setAttribute('opacity', opacity2);
		flow3.setAttribute('opacity', opacity3);
		flow4.setAttribute('opacity', opacity4);
		setInterval(opacity, 50);

		function opacity()
		{ 
			opacity1 += 0.05;
			if (opacity1 > 0.25 || opacity2 != 0)
				opacity2 += 0.05;
			if (opacity2 > 0.25 || opacity3 != 0)
				opacity3 += 0.05;
			if (opacity3 > 0.25 || opacity4 != 0)
				opacity4 += 0.05;
			flow1.setAttribute('opacity', opacity1);
			flow2.setAttribute('opacity', opacity2);
			flow3.setAttribute('opacity', opacity3);
			flow4.setAttribute('opacity', opacity4);
			if (opacity1 == 1 || opacity1 > 1) {
				if (opacity2 == 1 || opacity2 > 1){
					if (opacity3 == 1 || opacity3 > 1){
						if (opacity4 == 1 || opacity4 > 1){
							opacity1=0;
							opacity2=0;		
							opacity3=0;
							opacity4=0;
						}
					}
				}							
			}	
		}
